	this.selected_txt.lineWidth = 325;
	this.selected_txt.parent = this;
	this.selected_txt.setTransform(-182.3,-143.3);

	this.timeline.addTween(cjs.Tween.get(this.selected_txt).wait(2));

	// open_btn_layer
	this.open_btn = new lib.success_open_btn_mc();
	this.open_btn.name = "open_btn";
	this.open_btn.setTransform(-77.1,-131,1,1,0,0,0,110.9,16.9);

	this.timeline.addTween(cjs.Tween.get(this.open_btn).to({_off:true},1).wait(1));

	// Dropdown
	this.all_replacement_mc = new lib.all_replacement_mc();
	this.all_replacement_mc.name = "all_replacement_mc";
	this.all_replacement_mc.setTransform(-184.45,-130.2,1,1,0,0,0,0.1,15.1);
	this.all_replacement_mc.alpha = 0;

	this.all_replacement_mc_1 = new lib.all_replacement_mc();
	this.all_replacement_mc_1.name = "all_replacement_mc_1";
	this.all_replacement_mc_1.setTransform(-102.4,-130.3,1,1,0,0,0,81.9,15.1);
	this.all_replacement_mc_1.alpha = 0;

