	this.marketaccess_btn.name = "marketaccess_btn";
	this.marketaccess_btn.setTransform(-184.25,-69.85,1,1,0,0,0,0.1,15);

	this.mdpromo_btn = new lib.mdpromo_btn();
	this.mdpromo_btn.name = "mdpromo_btn";
	this.mdpromo_btn.setTransform(-184.3,-100.15,1,1,0,0,0,0.1,15.1);

